import React, { useState } from 'react';
import {
  Box,
  Typography,
  IconButton,
  TextField,
  Button,
  Link,
  InputAdornment
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

export default function LoginModal({ onClose }) {
  const [correo, setCorreo] = useState('');
  const [clave, setClave] = useState('');
  const [showClave, setShowClave] = useState(false);
  const [errores, setErrores] = useState({});

  const validar = () => {
    const nuevosErrores = {};
    if (!correo) nuevosErrores.correo = 'Ingrese su correo';
    if (!clave) nuevosErrores.clave = 'Ingrese su contraseña';
    setErrores(nuevosErrores);
    return Object.keys(nuevosErrores).length === 0;
  };

  const handleSubmit = () => {
    if (!validar()) return;

    // Aquí podrías hacer la llamada a login real
    console.log('Iniciando sesión con:', { correo, clave });
    onClose(); // Cerrar modal luego de login exitoso
  };

  return (
    <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100vw',
        height: '100vh',
        bgcolor: 'rgba(0,0,0,0.5)',
        zIndex: 1200,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
      <Box
        sx={{
          position: 'relative',
          width: { xs: '90%', sm: 420 },
          bgcolor: 'white',
          borderRadius: 3,
          boxShadow: 6,
          px: 4,
          pt: 4,
          pb: 3
        }}
      >
        {/* Botón cerrar */}
        <IconButton onClick={onClose} sx={{ position: 'absolute', top: 12, right: 12 }}>
          <CloseIcon />
        </IconButton>

        {/* Título */}
        <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#2e7d32', mb: 3 }}>
          Iniciar sesión
        </Typography>

        {/* Campo correo */}
        <TextField
          label="Correo electrónico"
          fullWidth
          value={correo}
          onChange={(e) => setCorreo(e.target.value)}
          error={Boolean(errores.correo)}
          helperText={errores.correo}
          sx={{ mb: 2 }}
        />

        {/* Campo contraseña con toggle */}
        <TextField
          label="Contraseña"
          fullWidth
          type={showClave ? 'text' : 'password'}
          value={clave}
          onChange={(e) => setClave(e.target.value)}
          error={Boolean(errores.clave)}
          helperText={errores.clave}
          placeholder="Escribe tu contraseña"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton
                  onClick={() => setShowClave(!showClave)}
                  edge="end"
                >
                  {showClave ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            )
          }}
          sx={{ mb: 1 }}
        />

        {/* Enlace recuperar */}
        <Typography variant="body2" sx={{ textAlign: 'right', mb: 3 }}>
          <Link href="#" underline="hover" sx={{ fontSize: '0.875rem' }}>
            Olvidé mi contraseña
          </Link>
        </Typography>

        {/* Botón entrar */}
        <Button
          fullWidth
          variant="contained"
          onClick={handleSubmit}
          sx={{
            bgcolor: '#fb8c00',
            color: 'white',
            fontWeight: 'bold',
            textTransform: 'none',
            py: 1.2,
            fontSize: '0.95rem',
            borderRadius: 2,
            mb: 2,
            '&:hover': { bgcolor: '#f57c00' }
          }}
        >
          Entrar
        </Button>

        {/* Enlace registro */}
        <Typography variant="body2" sx={{ textAlign: 'center' }}>
          ¿No tiene una cuenta?{' '}
          <Link href="#" underline="hover" sx={{ fontWeight: 'bold' }}>
            Regístrate
          </Link>
        </Typography>
      </Box>
    </Box>
  );
}
